export function Arrow() {
  return <img src={process.env.PUBLIC_URL + '/assets/icon/arrow-up.svg'} />;
}
export function Cancel() {
  return <img src={process.env.PUBLIC_URL + '/assets/icon/cancel.svg'} className='header-cancel' />;
}
export function Follow() {
  return <img src={process.env.PUBLIC_URL + '/assets/icon/follow.svg'} />;
}
export function Github() {
  return <img src={process.env.PUBLIC_URL + '/assets/icon/github.svg'} />;
}
export function Google() {
  return <img src={process.env.PUBLIC_URL + '/assets/icon/google.svg'} />;
}
export function Hits() {
  return <img src={process.env.PUBLIC_URL + '/assets/icon/hits.svg'} />;
}
export function Like() {
  return <img src={process.env.PUBLIC_URL + '/assets/icon/like.svg'} />;
}
export function Menu() {
  return <img src={process.env.PUBLIC_URL + '/assets/icon/menu.svg'} className='header-menu' />;
}
export function NewFollow() {
  return <img src={process.env.PUBLIC_URL + '/assets/icon/newFollow.svg'} />;
}
export function Search() {
  return <img src={process.env.PUBLIC_URL + '/assets/icon/search.svg'} />;
}
export function Sun() {
  return <img src={process.env.PUBLIC_URL + '/assets/icon/sun.svg'} />;
}
export function Moon() {
  return <img src={process.env.PUBLIC_URL + '/assets/icon/moon.svg'} />;
}
